"use strict";(self.webpackChunkrooch_network=self.webpackChunkrooch_network||[]).push([[45],{2190:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2023/2/9/blog/Partnership-Announcement-MoveBit","metadata":{"permalink":"/zh/blog/2023/2/9/blog/Partnership-Announcement-MoveBit","editUrl":"https://github.com/rooch-network/rooch-network.github.io/edit/main/blog/blog/2023-2-9-Partnership-Announcement-MoveBit.md","source":"@site/blog/blog/2023-2-9-Partnership-Announcement-MoveBit.md","title":"Partnership Announcement~ MoveBit <> Rooch","description":"logo-4","date":"2023-02-09T00:00:00.000Z","formattedDate":"2023\u5e742\u67089\u65e5","tags":[],"readingTime":0.89,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Partnership Announcement~ MoveBit <> Rooch"},"nextItem":{"title":"Partnership Announcement~ MoveFunsDao <> Rooch","permalink":"/zh/blog/2023/2/7/Partnership-Announcement-MoveFunsDAO"}},"content":"![logo-4](https://user-images.githubusercontent.com/99104408/217911743-1d9f34bd-d79a-4ccb-bbb6-9f8460845b36.png)\\nRooch Network will partner with MoveBit to ensure the highest possible level of security independently verified by an expert third party. Founded by experts and professors in security, MoveBit is a blockchain security company focused on Move ecosystem security. MoveBit will soon be a household name in the security audit sector of the blockchain industry. \\n\\n\u201cMoveBit is a security audit company for the Move ecosystem with a vision to make the Move ecosystem the most secure Web3 destination. The MoveBit team is comprised of security leaders from academia and enterprise with 10 years of security experience. The team was one of the earliest contributors to the Move ecosystem, working with Move developers to set the standard for secure Move applications.\u201d \\n\\nSome of MoveBit\u2019s recent audits include Aptos, Starcoin, Starcoin DAO, PolyNetwork, Starswap, Transit Finance, OmniBTC, MoveDID, and Cetus. \\n\\nRooch will secure independent formal verification through MoveBit audits during key stages of project development to ensure the utmost security and to create an atmosphere of trust for ecosystem participants. Security audits will be published in conjunction with MoveBit."},{"id":"/2023/2/7/Partnership-Announcement-MoveFunsDAO","metadata":{"permalink":"/zh/blog/2023/2/7/Partnership-Announcement-MoveFunsDAO","editUrl":"https://github.com/rooch-network/rooch-network.github.io/edit/main/blog/2023-2-7-Partnership-Announcement-MoveFunsDAO.md","source":"@site/blog/2023-2-7-Partnership-Announcement-MoveFunsDAO.md","title":"Partnership Announcement~ MoveFunsDao <> Rooch","description":"movefuns","date":"2023-02-07T00:00:00.000Z","formattedDate":"2023\u5e742\u67087\u65e5","tags":[],"readingTime":0.62,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Partnership Announcement~ MoveFunsDao <> Rooch"},"prevItem":{"title":"Partnership Announcement~ MoveBit <> Rooch","permalink":"/zh/blog/2023/2/9/blog/Partnership-Announcement-MoveBit"},"nextItem":{"title":"Hello Rooch","permalink":"/zh/blog/2022/11/27/hello-rooch"}},"content":"![movefuns](https://user-images.githubusercontent.com/99104408/217434466-c5670401-0094-4386-b0de-699e25f31650.png)\\nRooch Network has an established partnership with MoveFunsDAO, \\"A DAO for Move developers, with the main goal of uniting the developer community to build across multiple Move chain ecosystems.\\" At the date of this posting, MoveFunsDAO has gathered more than 250 Move developers for the purpose of collective action and learning within the broader Move ecosystem, including Aptos, Starcoin, and Sui.  \\nMost notably, MoveFuns has already organized a CTF MOVEment in December 2022 alongside organizers Aptos, Pontem Network, and Movebit, and we expect it to foster many great opportunities for developers rushing to Move. \\nMoveFunsDao & Rooch will keep a close relationship with the goal of empowering developers so the greater Move ecosystem can flourish while we grow an ever larger developer community."},{"id":"/2022/11/27/hello-rooch","metadata":{"permalink":"/zh/blog/2022/11/27/hello-rooch","editUrl":"https://github.com/rooch-network/rooch-network.github.io/edit/main/blog/2022-11-27-hello-rooch.md","source":"@site/blog/2022-11-27-hello-rooch.md","title":"Hello Rooch","description":"","date":"2022-11-27T00:00:00.000Z","formattedDate":"2022\u5e7411\u670827\u65e5","tags":[],"readingTime":0,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Hello Rooch"},"prevItem":{"title":"Partnership Announcement~ MoveFunsDao <> Rooch","permalink":"/zh/blog/2023/2/7/Partnership-Announcement-MoveFunsDAO"}},"content":""}]}')}}]);